import React, { useState } from 'react';
import Header from "./partials/Header"
import Search from "./search/Search";
import Definition from "./search/Definition";
import Image from "./search/Image";
import Pronunce from "./search/Pronunciation";
import  Save from "./search/save";
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {


  return (      <Router>
                <Switch>
                <Route to="/" exact component={Image} />
                <Route to="/" exact component={Definition} />
                <Route to="/" exact component={Pronunce} />
                <Route to="/" exact component={Save} />
                </Switch>
                </Router>
          )
}

export default App;
